    submitHandler = (event) => {
        event.preventDefault()
    }


    render() {
        return (
            <div className={classes.Auth}>
                <h1>Авторизация</h1>
                <form className={classes.AuthForm} onSubmit={this.submitHandler}>
                    <input type="text"/>
                    <input type="text"/>
                    <Button>Войти</Button>
                    <Button type="success" onClick={this.loginHandler}> Войти</Button>
                    <Button type="success" onClick={this.registerHandler}> Зарегистрироваться</Button>
                </form>
            </div>
        );
    }
}

export default Auth;
